import React from 'react'
import { Play } from '../Alies'

const BallPlace = (data:Play,ballPlace:boolean) => {
    if (ballPlace){
        data.ball_place = "KC"
    }else{
        data.ball_place = "LAC"
    }

  return null
}

export default BallPlace
